import "./searchForm.scss";
import ToggleSwitch from "../../ToogleSwitch/ToggleSwitch";
import { useState } from "react";
function SearchForm() {
    const [checked, setChecked] = useState(false);
  return (
    <div className='searchForm'>
      <div className='searchForm__searchLine'>
        <input className='searchForm__input' placeholder="Введите название фильма"></input>
        <button className='searchForm__button'>Найти</button>
      </div>
      <div className='searchForm__tumbler'>
        <ToggleSwitch id="toggleSwitch" checked={checked} onChange={setChecked}/>
        <p className='searchForm__short'>Короткометражки</p>
      </div>
    </div>
  );
}

export default SearchForm;
